import React from "react";
import Layout from "../../../Common/Component/Layout";
import "./index.scss";

import event1Img from "../../../Image/event1_image.jpg";
import event1MobileImg from "../../../Image/event1_image_mobile.jpg";
import event1BoxImg from "../../../Image/event1_box.png";
import liveBannerImg from "../../../Image/wizlive_banner01.png";
import eventCompeteImg from "../../../Image/event_complete.png";

export default function View(props) {
  const {
    count,
    // isTutorialCompleted,
    // isMarketingAgreement,
    // onClickBuildGame,
    onClickEvent2Banner
  } = props;
  return (
    <Layout>
      <div className="Page--EventDetail">
        <div className="event1">
          <img className="event1_img" src={event1Img} alt="event1" />
          <img
            className="event1_img event1_img-mobile"
            src={event1MobileImg}
            alt="event1-mobile"
          />
          <img
            className="event_complete"
            src={eventCompeteImg}
            alt="event complete"
          />
          {/* {isTutorialCompleted && isMarketingAgreement ? ( */}
          <button className="event1_btn event1_btn-disabled">
            이벤트 달성 완료!
          </button>
          {/* ) : ( */}
          {/* <button className="event1_btn" onClick={onClickBuildGame}> */}
          {/* 방탈출 게임 만들기 */}
          {/* </button> */}
          {/* )} */}
          <div className="event1_counts">
            <div className="event1_count">
              <img src={event1BoxImg} alt="event1" />
              <div className="event1_count_number">
                {Math.floor(count / 1000) % 10}
              </div>
            </div>
            <div className="event1_count">
              <img src={event1BoxImg} alt="event1" />
              <div className="event1_count_number">
                {Math.floor(count / 100) % 10}
              </div>
            </div>
            <div className="event1_count">
              <img src={event1BoxImg} alt="event1" />
              <div className="event1_count_number">
                {Math.floor((count / 10) % 10)}
              </div>
            </div>
            <div className="event1_count">
              <img src={event1BoxImg} alt="event1" />
              <div className="event1_count_number">{count % 10}</div>
            </div>
          </div>
          <div className="event1_event2Banner" onClick={onClickEvent2Banner} />
        </div>
        <a
          href="https://wizlive.com/?trial=2"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img class="Event1_LiveBanner" src={liveBannerImg} alt="live" />
        </a>
      </div>
    </Layout>
  );
}
